import React, { useEffect, useState } from 'react'
import { BarChart, CartesianGrid, XAxis, YAxis, Tooltip, Legend, Bar } from 'recharts'


const CompareMaterial = ({item}) => {

  console.log('chart result : ' , item.nutri_content);


  const data = [{
        name : `${item.detail_name}`,
        주요성분 : `${parseInt(item.nutri_content)}` 
      }]

  return (
    <div>
        <BarChart width={730} height={250} data={data}>
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Legend />
        {/* <Bar dataKey="name" fill="#8884d8" /> */}
        <Bar dataKey={item.nutri_name} fill="#82ca9d" />
        {/* <Bar dataKey="3" fill="#84ce5d" /> */}
      </BarChart>
    </div>
  )
}

export default CompareMaterial
